import React from "react"
import ms from "./Messages.module.css";
import Dialog from "@material-ui/core/Dialog";


const DeleteConfirmWindow = (props) =>{
    const closeWindow = () =>{
        props.SetToConfirmDeleting(false)
    }

    return <div>

        <Dialog className={ms.confirmDeletingWindow} open={props.ToConfirmDeleting}>

            <div className={ms.confirmDeletingWindowBody}>

                <button onClick={props.deleteMessage}>yes </button>

                &nbsp;&nbsp;

                <button onClick={closeWindow}> no</button>
            </div>

        </Dialog>

        </div>

}
export default DeleteConfirmWindow
